CREATE TABLE LOGIDONEITA
(
   CODICELOG varchar(10) PRIMARY KEY,
   GENERALE smallint DEFAULT 0,
   CODINTERNODONAT varchar(10),
   IDONEITA int DEFAULT 0,
   MOTIVOSOSPENSIONE varchar(20),
   DALLADATA datetime,
   ALLADATA datetime,
   NOTAIDONEITA text,
   EMOC_01 smallint DEFAULT 0,
   EMOC_02 smallint DEFAULT 0,
   EMOC_03 smallint DEFAULT 0,
   EMOC_04 smallint DEFAULT 0,
   EMOC_05 smallint DEFAULT 0,
   EMOC_06 smallint DEFAULT 0,
   EMOC_07 smallint DEFAULT 0,
   EMOC_08 smallint DEFAULT 0,
   EMOC_09 smallint DEFAULT 0,
   EMOC_10 smallint DEFAULT 0,
   CHIUSA smallint DEFAULT 0,
   LETTERASTAMPATA smallint DEFAULT 0
)
;

CREATE UNIQUE INDEX PK_LOGIDONEITA ON LOGIDONEITA (CODICELOG)
;



